import React from 'react';
import Game from '../Game/Game';
import  { Grid, Segment } from 'semantic-ui-react';

const GamesContainer = (props) => {
    const { games } = props
    return (
        <Grid columns={3} divided>
            <Grid.Row>
            games.map(game => <Game game={game} />)}
            </Grid.Row>

        </Grid>

    )
}



export default GamesContainer;
